import axios from 'axios'
import {
    Chart as ChartJS,
    RadialLinearScale,
    PointElement,
    LineElement,
    Filler,
    Tooltip,
    Legend,
  } from 'chart.js';
  import { Radar } from 'react-chartjs-2';
  
  ChartJS.register(
    RadialLinearScale,
    PointElement,
    LineElement,
    Filler,
    Tooltip,
    Legend
  );

export default function MarksRadar(){
     const data = {
        labels: ['Stochastic', 'SDA', 'OS', 'Database', 'Linear'],
        datasets: [
          {
            label: '# of Votes',
            data: [100, 75, 80, 65, 99, 40],
            backgroundColor: 'rgba(255, 99, 132, 0.2)',
            borderColor: 'rgba(255, 99, 132, 1)',
            borderWidth: 1,
          },
        ],
      };
    return(
    <>
        <Radar data = {data}/>
    </>
    )
}
